import React from 'react';
import { Link } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import './explore.css';

const activities = [
  {
    name: "Volunteer Activity 1",
    image: "https://example.com/activity1.jpg",
    category: "Category 1",
    location: "Location 1"
  },
  {
    name: "Volunteer Activity 2",
    image: "https://example.com/activity2.jpg",
    category: "Category 2",
    location: "Location 2"
  },
  // Add more activities as needed
];

const Explore = (props) => {
  const handleClick = (activity) => {
    // Pass activity details to your API endpoint
    console.log("Clicked Activity:", activity);
    // You can call your API endpoint here
  };

  return (
    <div className="explore-container">
      <Helmet>
        <title>Explore - ServeQuest</title>
        <meta property="og:title" content="Explore - ServeQuest" />
      </Helmet>
      <div className="explore-calendar">
        {/* Header and navigation */}
      </div>
      <span className="explore-text06">Explore</span>
      <div className="explore-container1">
        <div className="explore-container2">
          <div className="explore-container3">
            {activities.map((activity, index) => (
              <div className="explore-container4" key={index}>
                <img
                  src={activity.image}
                  alt="Activity"
                  className="explore-image"
                />
                <span>{activity.name}</span>
                <button
                  className="explore-button"
                  onClick={() => handleClick(activity)}
                >
                  View Details
                </button>
              </div>
            ))}
          </div>
        </div>
      </div>
      <span className="explore-text08">
        <span>Here are some activities catered to your profile. Gain experience points as you do activities!</span>
      </span>
    </div>
  );
}

export default Explore;
